import { Container, Row, Col } from 'react-bootstrap';

const InfoDetails = () => {
    return(

        <Container>
            <Row>
                <Col><p>1 of 2</p></Col>
                <Col><p>2 of 2</p></Col>
            </Row>
        </Container>
    )
}

export default InfoDetails
